import React from 'react';
import './NavBar.css';

const NavBar = () => {
  return (
    <div className='hero'>
      <nav>
        <h2 className='logo'>Learn<span>ify</span></h2>
        <ul>
          <li><a href='/'>Home</a></li>
          <li><a href='/'>About</a></li>
          <li><a href='/'>Contact</a></li>
        </ul>
        <button type='button'>Login</button>
      </nav>
    </div>
  );
};

export default NavBar;
